import path from 'path';

export default async function(page, fileUrl, screenshotsDir) {
  try {
    // Navigate to the HTML file
    await page.goto(fileUrl);
    await page.waitForLoadState('networkidle');

    // Take initial screenshot
    const screenshots = [];
    await page.screenshot({ path: path.join(screenshotsDir, 'step_1_initial.png') });
    screenshots.push(path.join(screenshotsDir, 'step_1_initial.png'));

    // Interact with the search input to search for a non-existent event
    await page.waitForSelector('#eventSearchInput');
    await page.fill('#eventSearchInput', 'nonexistent');
    await page.waitForTimeout(500); // Wait for any dynamic content to load

    // Take a screenshot after entering the search term
    await page.screenshot({ path: path.join(screenshotsDir, 'step_2_search_input.png') });
    screenshots.push(path.join(screenshotsDir, 'step_2_search_input.png'));

    // Click the search button
    await page.waitForSelector('button.search-btn');
    await page.click('button.search-btn');

    // Wait for the results to load and check for no results
    await page.waitForTimeout(1000); // Wait for results to load

    // Take a screenshot of the results area
    await page.screenshot({ path: path.join(screenshotsDir, 'step_3_no_results.png') });
    screenshots.push(path.join(screenshotsDir, 'step_3_no_results.png'));

    // Extract meaningful data to verify task completion
    const noResultsMessage = await page.locator('text=No events found').isVisible();

    return {
      success: true,
      action: "Searched for a non-existent event and verified no results",
      extractedData: { noResultsMessage },
      screenshots,
      error: null
    };
  } catch (error) {
    return {
      success: false,
      action: "Failed to complete task",
      extractedData: {},
      screenshots: [],
      error: error.message
    };
  }
}

